window.bookSummaryJSON = "<p><i>Star Druid: Publisher's Pack</i> contains books 1 and 2 of the Star Druid series. </p> <p><b><i>Star Druid</i></b><b>, book 1: </b></p> <p>What is an exiled druid to do when their order is destroyed by a rising tide of darkness?</p> <p>1. Seize magical power. <br> 2. Get rich. <br> 3. Gather a harem of beautiful women. <br> 4. Revenge. Sweet, sweet revenge. </p> <p><b><i>The Burning Grove</i></b><b>, book 2: </b></p> <p>Antihero or villain? </p> <p>The rebuilding of the Druid order is going well but those who attacked it the first time have not given up on their schemes and once more Banok finds himself on a mission that he'll do anything to complete. Brutal choices and twists abound. </p> <p>Note: This series is space fantasy. Real physics are ignored, and spells are slung. There is also violence, sex, and other things people might enjoy.</p>"; 
